import { CoreModule } from './core/core.module';
import { HomeAdvComponent } from './home/components/home-adv/home-adv.component';



@NgModule({
  declarations: [
    AppComponent,
    HomeAdvComponent

  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    CoreModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
